import React, { Component } from "react";
// import axios from 'axios';
import { route } from "react-router-dom";

import Posts from "./Posts/Posts";
import "./Blog.css";

class Blog extends Component {
  render() {
    return (
      <div>
        <header>
          <ul>
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/new-post">New Post</a>
            </li>
          </ul>
        </header>

        <Posts />
      </div>
    );
  }
}

export default Blog;
